import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { HttpClientModule } from '@angular/common/http';
import { ReactiveFormsModule } from '@angular/forms';
import { RouterModule, Routes } from '@angular/router';

import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatButtonModule } from '@angular/material/button';
import { MatDatepickerModule } from '@angular/material/datepicker';
import { MatNativeDateModule } from '@angular/material/core';
import { MatTableModule } from '@angular/material/table';
import { MatIconModule } from '@angular/material/icon';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatSelectModule } from '@angular/material/select';
import { MatSnackBarModule } from '@angular/material/snack-bar';
import { MatCardModule } from '@angular/material/card';
import { MatDialogModule } from '@angular/material/dialog';

import { AppComponent } from './app.component';
import { PersonFormComponent } from './person-form/person-form.component';
import { MenuComponent } from './menu/menu.component';
import { PresencaComponent } from './presenca/presenca.component';
import { PresencaModalComponent } from './presenca/presenca-modal/presenca-modal.component';
import { PersonModalComponent } from './person-form/person-modal/person-modal.component';

const routes: Routes = [
  { path: 'cadastro', component: PersonFormComponent },
  { path: 'presenca', component: PresencaComponent },
  { path: '', redirectTo: '/cadastro', pathMatch: 'full' }
];

@NgModule({
  declarations: [
    AppComponent,
    PersonFormComponent,
    MenuComponent,
    PresencaComponent,
    PresencaModalComponent,
    PersonModalComponent
  ],
  imports: [
    BrowserModule,
    BrowserAnimationsModule,
    HttpClientModule,
    ReactiveFormsModule,
    RouterModule.forRoot(routes),
    MatFormFieldModule,
    MatInputModule,
    MatButtonModule,
    MatDatepickerModule,
    MatNativeDateModule,
    MatTableModule,
    MatIconModule,
    MatToolbarModule,
    MatSelectModule,
    MatSnackBarModule,
    MatCardModule,
    MatDialogModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
